package DTO;

public class Local {
	private int idLocal;
	private String tipoLocal;
	private String nombreLocal;
	private String provLocal;
	private String cuidadLocal;
	private String dirLocal;
	private String telf1;
	private String telf2;
	
	public Local() {
		// TODO Auto-generated constructor stub
	}

	public int getIdLocal() {
		return idLocal;
	}

	public void setIdLocal(int idLocal) {
		this.idLocal = idLocal;
	}

	public String getTipoLocal() {
		return tipoLocal;
	}

	public void setTipoLocal(String tipoLocal) {
		this.tipoLocal = tipoLocal;
	}

	public String getNombreLocal() {
		return nombreLocal;
	}

	public void setNombreLocal(String nombreLocal) {
		this.nombreLocal = nombreLocal;
	}
	public String getProvLocal() {
		return provLocal;
	}

	public void setProvLocal(String provLocal) {
		this.provLocal = provLocal;
	}

	public String getCuidadLocal() {
		return cuidadLocal;
	}

	public void setCuidadLocal(String cuidadLocal) {
		this.cuidadLocal = cuidadLocal;
	}

	public String getDirLocal() {
		return dirLocal;
	}

	public void setDirLocal(String dirLocal) {
		this.dirLocal = dirLocal;
	}

	public String getTelf1() {
		return telf1;
	}

	public void setTelf1(String telf1) {
		this.telf1 = telf1;
	}

	public String getTelf2() {
		return telf2;
	}

	public void setTelf2(String telf2) {
		this.telf2 = telf2;
	}
	

}
